import Logo from '../../assets/logo.jpg';
import './Header.css'

const Header = () => {
    return(
        <div className="header">
            <div className="container">
                <div className='logo'>
                    <img src={Logo} alt="Logo b8one" />
                </div>
                <div className=''>
                    <p>Teste Dev Front-End</p>
                </div>
            </div>
        </div>
    )
}

export default Header;
